import React from "react";
import { Typography } from "@mui/material";

const Balance = ({ account, accountNumber }) => {
  return (
    <div style={{ border: "2px solid grey", padding: 16, width: 500 }}>
      <Typography variant="h5" color="grey">
        ACCOUNT {accountNumber}
      </Typography>
      <Typography variant="p" color="grey">
        Euro Balance
      </Typography>
      <Typography variant="h5" color="grey">
        {account["EUR"]}
      </Typography>
      <Typography variant="p" color="grey">
        US Dollar Balance
      </Typography>
      <Typography variant="h5" color="grey">
        {account["USD"]}
      </Typography>
    </div>
  );
};

export default Balance;
